import { MasterDetailIcon } from "@sanity/icons";
import { type } from "os";

export default {
  name: "blogCategory",
  type: "document",
  title: "Blog Category",
  icon: MasterDetailIcon,
  i18n: {
    fieldNames: {
      lang: "i18n_lang",
      baseReference: "i18n_base",
      references: "i18n_refs",
    },
  },

  fields: [
    {
      name: "i18n_lang",
      type: "string",
      hidden: true,
    },
    {
      name: "i18n_base",
      type: "reference",
      to: [{ type: "blogCategory" }],
      hidden: true,
    },
    {
      name: "i18n_refs",
      type: "array",
      hidden: true,
      of: [
        {
          type: "reference",
          to: [{ type: "blogCategory" }],
        },
      ],
    },
    {
      title: "Section Title",
      name: "sectionTitle",
      type: "string",
      validation: (Rule) => Rule.required(),
    },
    {
      title: "Title",
      name: "title",
      type: "string",
    },
    {
      name: "slug",
      title: "Slug",
      type: "slug",
      options: {
        source: "title",
        maxLength: 96,
      },
    },
    {
      title: "Position",
      name: "position",
      type: "string",
    },
    {
      title: "Number of posts",
      name: "numberOfPosts",
      type: "number",
    },
    {
      title: "Component",
      name: "component",
      type: "string",
      initialValue: "BlogList",
      readOnly: true,
      hidden: true,
      validation: (Rule) => Rule.required(),
    },
    {
      name: "seo",
      type: "seo",
    },
  ],
};

